/* eslint-disable jsx-a11y/anchor-is-valid */
export default function NavBar() {
  return (
    <div className="ui nav">
      <img
        className="logo"
        src="./images/logo/airbnb.svg"
        width="150px"
        alt="logo"
      />
    </div>
  );
}
